measurements.description:
Six flowers of good form and dark color and four buds on two upright 40-cm inflorescences; 

	dorsal sepal white, overlaid chartreuse centrally, heavily overlaid maroon proximally, 

	veined maroon; petals chartreuse, blotched mahogany proximally, consistently rolled, 

	spathulate, purple distally; synsepal chartreuse, veined darker; pouch chartreuse, 

	overlaid mahogany, veined darker, staminode chartreuse, mottled darker green; 

	substance firm; texture matte, pouch texture glossy.
